import AppLayout from "../components/AppLayout";
import Head from "next/head";
import { useSelector } from "react-redux";

const Home = () => {
  const { isLoggedIn } = useSelector((state) => state.user);
  return (
    <div>
      <Head>
        <title>NodeBird | Home</title>
      </Head>
      <AppLayout>
        <PostForm></PostForm>
        <PostCard></PostCard>
      </AppLayout>
    </div>
  );
};

export default Home;
